	private static class PurgeVelocidadTask implements Runnable {


		private final int							sessionId;
		private final long							startTime;
		private final IMultiConnectionSqlExecutor	sqlEntity;
		private final AtomicInteger					count;

		public PurgeVelocidadTask(IMultiConnectionSqlExecutor sqlEntity, int sessionId, long startTime, AtomicInteger count) {
			this.sessionId = sessionId;
			this.startTime = startTime;
			this.sqlEntity = sqlEntity;
			this.count = count;
		}

		@Override
		public void run() {
			while (true) {
				try {
					Object matricula = PurgeCDVELOCIDAD.queueIds.poll();
					if (matricula == null) {
						System.out.println(Thread.currentThread().getName() + " exits");
						return;
					}
					long time = System.currentTimeMillis();
					EntityResult response = this.sqlEntity.execute(null,
							"delete from TACHBB102011.CDVELOCIDAD where FECHORA < (sysdate - " + PurgeCDVELOCIDAD.NUM_DAYS + ")  and matricula = '" + matricula + "'",
							this.sessionId);
					int num = this.count.incrementAndGet();
					System.out.println(Thread.currentThread().getName() + ":" + matricula + "(" + num + "," + (((System.currentTimeMillis() - time))) + "):" + response
							.get("RESULT"));
					// }
				} catch (Exception ex) {
					ex.printStackTrace();
					System.err.println(Thread.currentThread().getName());
					return;
				}
			}
		}

	}
